    {
      "isPinned": false,
      "isEdited": true,
      "threadUrn": "",
      "createdAt": 1711641637817,
      "createdAtString": "2020-08-05 05:14:15",
      "permalink": "https://www.linkedin.com/feed/update/urn:li:activity:7179144327430844416?commentUrn=urn%3Ali%3Acomment%3A%28activity%3A7179144327430844416%2C7179145368058646528%29&dashCommentUrn=urn%3Ali%3Afsd_comment%3A%287179145368058646528%2Curn%3Ali%3Aactivity%3A7179144327430844416%29",
      "text": "Do not heed any guidance on what is or is not “realistic”, you’ll only end up stifling your own growth. \n\nPay no mind to anyone who tries to tell you that you’re “too much”, you’ll only make yourself smaller for the comfort of those who see you as a threat to the status quo. \n\nGo to therapy, and go often. \n\nImposter syndrome is just your brain making the grave mistake of assuming that everyone around you knows what they’re doing. Ignore it, you’re doing great.",
      "author": {
        "name": "Tara Bachy, MA-IBP",
        "urn": "ACoAAA4U54MB2j7wB68UePtShFqivDMDvZKtXEw",
        "username": "ACoAAA4U54MB2j7wB68UePtShFqivDMDvZKtXEw",
        "linkedinUrl": "https://www.linkedin.com/in/ACoAAA4U54MB2j7wB68UePtShFqivDMDvZKtXEw",
        "title": "Be the person you'd want to hang out and collaborate with for the duration of a legally binding contract."
      }
    },
